const mqs = {
	xs:  360,
	sm:  375,
	md:  768,
	lg:  1024,
	xl:  1280,
	xxl: 1920,
};

const bps = Object.keys(mqs);

const gaps = [1, 2];

function testMqs(html, expecteds, assert) {
	const done = assert.async(bps.length);

	tpl(html, root => {
		let actual;

		let bps2 = bps.slice();

		let bp;

		function next() {
			bp = bps2.shift();
			iframe.style.width = mqs[bp] + "px";
		}

		function check() {
			actual = getRects(root);
			assert.deepEqual(actual, expecteds[bp], bp);
			console.log(bp + ":", JSON.stringify(actual));
		}

		next();
		check();

		let it = setInterval(() => {
			done();

			if (bps2.length == 0) {
				clearInterval(it);
				return;
			}

			next();
			check();
		}, 0);
	});
}

